import React from 'react';
import "./Cuisine.css";
function CuisineCard({ title, link }) {
  return (
    <div className="Cuisine_card">
      <img src={link} alt='Food' />
      <h3>{title}</h3>
    </div>
  );
}

export default function Cuisine() {
  const cuisines = [
    { link: "data:image/jpeg;base64,", title: "Indian" },
    { link: "data:image/jpeg;base64,", title: "Chinese" },
    { link: "data:image/jpeg;base64,", title: "Thai" },
    { link: "data:image/jpeg;base64,", title: "Mexican" },
    { link: "data:image/jpeg;base64,", title: "Japanese" },
    { link: "data:image/jpeg;base64,", title: "Korean" },
  ];

  return (
    <div className="Cuisine_container">
      <h2>Cuisines</h2>
      <div className="cuisines_grid">
        {cuisines.map((cuisine, index) => (
          <CuisineCard key={index} title={cuisine.title} link={cuisine.link} />
        ))}
      </div>
    </div>
  );
}
